import axios from "axios";
import { REGISTER_API, LOGIN_API, PROFILE_API } from "./config";

axios.defaults.headers.common["x-auth-token"] = JSON.parse(
  localStorage?.session
).access_token;

export const REGISTER_SERVICE = (data) =>
  axios({
    method: "POST",
    url: REGISTER_API,
    headers: {
      "content-type": "application/json",
    },
    data: data,
  });

export const LOGIN_SERVICE = (data) =>
  axios({
    method: "POST",
    url: LOGIN_API,
    headers: {
      "content-type": "application/json",
    },
    data: data,
  });

export const PROFILE_SERVICE = (data) =>
  axios({
    method: "POST",
    url: PROFILE_API,
    headers: {
      "content-type": "application/json",
      "x-auth-token": JSON.parse(localStorage?.session).access_token,
    },
    data: data,
  });
